import React, { useState } from "react";
import {
  Container,
  Row,
  Col,
  Form,
  FormControl,
  Button,
  InputGroup,
  DropdownButton,
  Dropdown,
} from "react-bootstrap";
import { FaStar } from "react-icons/fa";

const searchResults = [
  {
    id: 1,
    name: "Acana Grasslands Cat Food",
    description:
      "Biologically Appropriate, grain-free cat food made with fresh regional ingredients, including free-run chicken and turkey, wild-caught fish, and cage-free eggs.",
    price: 29.99,
    rating: 4.8,
    reviews: 35,
    distance: 0.7,
    store: "PetSmart",
    image:
      "https://www.petco.com/shop/PetcoPingUserType?requesttype=ajax&catalogId=10051&storeId=10151&langId=-1&objectId=53825&cmpid=PSG%7Cpetco_main_nonbrand_&msclkid=bc6eabf262b11e6d5ba3eae0c48b1d2a&utm_source=bing&utm_medium=cpc&utm_campaign=Non-Brand%7CPLA%7CPetco%7CCatchAll%7CBing&utm_term=4584180348832795&utm_content=Petco_Main",
  },
  {
    id: 2,
    name: "Merrick Backcountry Raw Infused Dog Food",
    description:
      "High-protein, grain-free kibble infused with freeze-dried raw pieces for a boost of nutrition and flavor.",
    price: 69.99,
    rating: 4.6,
    reviews: 22,
    distance: 1.2,
    store: "Petco",
    image:
      "https://www.petco.com/shop/PetcoPingUserType?requesttype=ajax&catalogId=10051&storeId=10151&langId=-1&objectId=53305&cmpid=PSG%7Cpetco_main_nonbrand_&msclkid=bc6eabf262b11e6d5ba3eae0c48b1d2a&utm_source=bing&utm_medium=cpc&utm_campaign=Non-Brand%7CPLA%7CPetco%7CCatchAll%7CBing&utm_term=4584180348832795&utm_content=Petco_Main",
  },
];

export default function SearchResult() {
  const [searchInput, setSearchInput] = useState("");
  const [optionsFilter, setOptionsFilter] = useState("All");

  const handleSearchInputChange = (event) => {
    setSearchInput(event.target.value);
  };

  const handleOptionsFilterChange = (event) => {
    setOptionsFilter(event.target.innerText);
  };

  const filteredResults = searchResults.filter((result) =>
    result.name.toLowerCase().includes(searchInput.toLowerCase())
  );

  return (
    <Container>
      <Row className="mt-5">
        <Col xs={12} sm={12} md={12} lg={12}>
          <h1>Search Results</h1>
          <InputGroup className="mb-3">
            <DropdownButton
              as={InputGroup.Prepend}
              variant="outline-secondary"
              title={optionsFilter}
              id="input-group-dropdown-1"
            >
              <Dropdown.Item onClick={handleOptionsFilterChange}>
                All
              </Dropdown.Item>
              <Dropdown.Item onClick={handleOptionsFilterChange}>
                Food
              </Dropdown.Item>
              <Dropdown.Item onClick={handleOptionsFilterChange}>
                Shelter
              </Dropdown.Item>
            </DropdownButton>
            <FormControl
              type="text"
              placeholder="Enter search term"
              value={searchInput}
              onChange={handleSearchInputChange}
            />
            <InputGroup.Append>
              <Button variant="primary" type="submit">
                Search
              </Button>
            </InputGroup.Append>
          </InputGroup>
        </Col>
      </Row>
      <Row>
        {filteredResults.map((result) => (
          <Col xs={12} sm={6} md={4} lg={3} key={result.id}>
            <div className="border mb-4 p-3">
              <div className="text-center">
                <img
                  src={result.image}
                  alt={result.name}
                  className="img-fluid"
                />
              </div>
              <h5 className="mt-3">{result.name}</h5>
              <p>{result.description}</p>
              <div className="d-flex justify-content-between">
                <div>
                  <span className="mr-1">${result.price}</span>
                  <small className="text-muted">per lb</small>
                </div>
                <div>
                  <span className="text-warning mr-1">
                    {result.rating.toFixed(1)}
                  </span>
                  <small className="text-muted">{result.reviews} reviews</small>
                </div>
              </div>
              <hr />
              <div className="d-flex justify-content-between">
                <div>
                  <span className="text-muted">Distance:</span>{" "}
                  {result.distance.toFixed(1)} miles
                </div>
                <div>
                  <span className="text-muted">Store:</span> {result.store}
                </div>
              </div>
            </div>
          </Col>
        ))}
      </Row>
    </Container>
  );
}
